The test case here only cares about the leader master, so I don't think it's necessary to make sure the restarted master should be online, that means calling "mini_master->WaitForCatalogManagerInit()" is not required. Besides, there is evidence that the restarted master had been online before failure, please look at the full test output from Line2136 to Line2168.

